package zakjo.studentsapp.model;public class Groups {    public String group_id ;    public String group_name ;    public String group_days ;    public String c_id ;    public String t_id ;    public String g_pay_method ;    public String g_pay_amount ;    public String g_books_price ;    public String t_rate ;    public String reg_fees ;    public String count ;    public String from_hour ;    public String to_hour ;    public String max ;    public Groups() {}    public Groups(String group_id, String group_name, String group_days, String c_id, String t_id, String g_pay_method, String g_pay_amount, String g_books_price, String t_rate, String reg_fees, String count, String from_hour, String to_hour, String max) {        this.group_id = group_id;        this.group_name = group_name;        this.group_days = group_days;        this.c_id = c_id;        this.t_id = t_id;        this.g_pay_method = g_pay_method;        this.g_pay_amount = g_pay_amount;        this.g_books_price = g_books_price;        this.t_rate = t_rate;        this.reg_fees = reg_fees;        this.count = count;        this.from_hour = from_hour;        this.to_hour = to_hour;        this.max = max;    }    public String getGroup_id() {        return group_id;    }    public void setGroup_id(String group_id) {        this.group_id = group_id;    }    public String getGroup_name() {        return group_name;    }    public void setGroup_name(String group_name) {        this.group_name = group_name;    }    public String getGroup_days() {        return group_days;    }    public void setGroup_days(String group_days) {        this.group_days = group_days;    }    public String getC_id() {        return c_id;    }    public void setC_id(String c_id) {        this.c_id = c_id;    }    public String getT_id() {        return t_id;    }    public void setT_id(String t_id) {        this.t_id = t_id;    }    public String getG_pay_method() {        return g_pay_method;    }    public void setG_pay_method(String g_pay_method) {        this.g_pay_method = g_pay_method;    }    public String getG_pay_amount() {        return g_pay_amount;    }    public void setG_pay_amount(String g_pay_amount) {        this.g_pay_amount = g_pay_amount;    }    public String getG_books_price() {        return g_books_price;    }    public void setG_books_price(String g_books_price) {        this.g_books_price = g_books_price;    }    public String getT_rate() {        return t_rate;    }    public void setT_rate(String t_rate) {        this.t_rate = t_rate;    }    public String getReg_fees() {        return reg_fees;    }    public void setReg_fees(String reg_fees) {        this.reg_fees = reg_fees;    }    public String getCount() {        return count;    }    public void setCount(String count) {        this.count = count;    }    public String getFrom_hour() {        return from_hour;    }    public void setFrom_hour(String from_hour) {        this.from_hour = from_hour;    }    public String getTo_hour() {        return to_hour;    }    public void setTo_hour(String to_hour) {        this.to_hour = to_hour;    }    public String getMax() {        return max;    }    public void setMax(String max) {        this.max = max;    }}